import logo from './logo.svg';
import './App.css';
import Header from './Components/Header';
import SideBar from './Components/SideBar';
import Dashboard from './Components/Dashboard';
import Footer from './Components/Footer';
import BlankPage from './Pages/BlankPage';

import {
  BrowserRouter as Router,
  Route,
  Routes
  // Link,
  // Switch,
} from "react-router-dom";

function App() {
  return (
    <div className="wrapper">
      <Header/>
      <SideBar logo={logo} title="New Title"/>
       <div className="content-wrapper">
          <Router>
            <Routes>
                  <Route path="/MenuA" element={ <BlankPage/>} />
                  <Route path="/MenuB" element={ <BlankPage/>} />
                  <Route path="/MenuC" element={ <BlankPage/>} />
                  <Route path="/MenuD" element={ <BlankPage/>} />
                  <Route path="/Sales-Order" element={ <BlankPage/>} />
                  <Route path="/Purchase-Order" element={ <BlankPage/>} />
                  <Route path="/about" element={ <BlankPage/>} />
                  <Route path="/" element={ <Dashboard/>} />
            </Routes>
            </Router>
      </div>
      <Footer/>

    </div>
  );
}

export default App;
